def sum_good(a: int, b: int) -> int:
    """Returns sum of two integers.
    :param a: first integer
    :param b: second integer
    :return: sum of parameters a and b
    """
    return a + b

def sum_bad(a: int, b: int):  # [missing-return-doc]
    """Returns sum of two integers.
    :param a: first integer
    :param b: second integer
    """
    return a + b
